import styled from "styled-components";

export default styled.div`
    font-family: ${props => (props.primary ? "Gill Sans" : "Marion")};
    font-size: ${props => (props.primary ? "12px" : "22px")};
    text-align: left;
    color: white;
    padding-left: 1em;
    padding-top: 1em;
    line-height: .2em;
`;
